import React, { useEffect } from 'react'
import { connect } from 'react-redux';
import { fetchNewsData } from '../redux/Action';


const NewsContainer = ({ news, fetchNewsData }) => {
    console.log('news in container', news);
    useEffect(() => {
        fetchNewsData()
    }, [])
    return (
        news.loading ? (
            <h2>Loading</h2>
        ) : news.error ? (
            <h2>{news.error}</h2>
        ) : (
            <>
                <h2>News List</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th scope="col">Title</th>
                        <th scope="col">Description</th>
                        <th scope="col">Author</th>
                        <th scope="col">PublishedAt</th>
                        <th scope="col">Name</th>

                    </tr>
                </thead>
                {news.map((data, id) => {
                    {/* console.log(id) */}
                    return (
                        <tr key={id}>
                            <td>{data.title}</td>
                            <td>{data.description}</td>
                            <td>{data.author}</td>
                            <td>{data.publishedAt}</td>
                            <td>{data.source.name}</td>
                        </tr>
                    )

                })}
            </table>



            </>
        )
    )


}


const mapStateToProps = state => {
    console.log('state toprops', state, 'news', state.news);
    return {
        news: state.newsdata.news

    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchNewsData: () => dispatch(fetchNewsData())
    }
}


export default connect(mapStateToProps, mapDispatchToProps)(NewsContainer)
